	student_first VARCHAR(50),
	student_last VARCHAR(50),
	student_gender VARCHAR(50),
	class1 VARCHAR(23),
	class2 VARCHAR(23),
	class3 VARCHAR(23),
	class4 VARCHAR(23),
	class5 VARCHAR(23),
	class6 VARCHAR(23),
	class7 VARCHAR(23),
	class8 VARCHAR(23),
	teacher1 VARCHAR(18),
	teacher2 VARCHAR(18),
	teacher3 VARCHAR(18),
	teacher4 VARCHAR(18),
	teacher5 VARCHAR(18),
	teacher6 VARCHAR(18),
	teacher7 VARCHAR(18),
	teacher8 VARCHAR(18)
);
